import React from "react";
import logo from "./logo.svg";
import CustomChatbot from "./components/chatbot/CustomChatbot";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <CustomChatbot />
    </div>
  );
}

export default App;
